import React from 'react'

const Calculator = () => {
const numbers = ['C', '1', '2', '+', '3', '4', '-', '5', '6', '*', '7', '8', '/', '=', '9', '0', '.']
  
const inputChange = (e) => {
    e.target.value;
}
return (
    <>
   <div className="calstyle">
    <input className="inputstyle" type='text' readOnly onChange={inputChange}/>
    <div className="buttonstyle">
    {
        numbers.map((allNumbers)=>{
            return(    
                
     <button className="buttons">{allNumbers}</button>
     
    )
        })
    }
    </div>
   
   </div>
    </>
  )
}

export default Calculator
